from collections import Counter, defaultdict

def isValid(s):
    char_freq = Counter(s)
    first_freq = char_freq[s[0]]
    unique_freq = list(set(char_freq.values()))

    # Valid string bc all char freq the same
    if len(unique_freq) == 1:
        return 'YES'

    # Not valid as would require two+ adjustments
    if len(unique_freq) > 2:
        return 'NO'
    
    # Get the char to frequency
    freq_to_val = Counter(char_freq.values())
    first, second = unique_freq.pop(), unique_freq.pop()

    # Check if abs diff is 1 or elem is 1 AND freq is 1
    if (abs(first - second) == 1 or first == 1) and (freq_to_val[first] == 1):
        return 'YES'
    elif (abs(second - first) == 1 or second == 1) and (freq_to_val[second] == 1):
        return 'YES'
    
    return 'NO'

    
# a - 2, b - 2, c - 1, d - 1
print(isValid('aabbcd') == 'NO')
print(isValid('abc') == 'YES')  
print(isValid('') == 'YES')
print(isValid('') == 'YES')  